import React from "react";
import "../css/home.css";

const Home = () => {
  return (
    <div id="bigFlexContainer">
      <div id="homeHeaderContainer">
        <div id="homeIcon"></div>
        <h1 id="homeTitle">La maison jungle</h1>
      </div>
      <div id="mainContainer">
        <div id="cartContainer">
          <div id="cartHeader">Votre panier</div>
        </div>
        <div id="rightContainer"></div>
      </div>
    </div>
  );
};

export default Home;
